import React from 'react'

export default function ActivitiesDetail({actsDetail, country}) {



  return (
    <div>
        <h3>Activities for {country}</h3>
        {
            actsDetail?.map(el =>  (
               
            <ul key={el.id}>
            <h3>{el.name}</h3>
            <h3>{el.duration}</h3>
            <h3>{el.difficulty}</h3>
            <h3>{el.season}</h3>
            </ul>
            ))
        }
        
    </div>
  )
};
